import React from 'react';
import '../style.css';

function Make({handleChange, value, searchName, data}) {
    return (
        <div>
            <form>
              <label className="label">Select Car Makes: </label>
              <select onChange={handleChange} className="select_menu">
                {data.map(() => {
                    <option className="select_optionMenu" value={value}>{searchName}</option>
                })}
                
              </select>
            </form>
        </div>
    )
}

export default Make
